import React, { useState } from 'react';
import axios from 'axios';
import { Button, Container, CssBaseline, Typography, TextField, Grid, CircularProgress, Snackbar, AppBar, Toolbar, IconButton } from '@material-ui/core';
import MuiAlert from '@material-ui/lab/Alert';
import { makeStyles } from '@material-ui/core/styles';

function Alert(props) {
    return <MuiAlert elevation={6} variant="filled" {...props} />;
}

const useStyles = makeStyles((theme) => ({
    root: {
        flexGrow: 1,
    },
    appBar: {
        backgroundColor: '#BA0C2F', // JLL Red color
    },
    logo: {
        flexGrow: 1,
    },
    paper: {
        marginTop: theme.spacing(8),
        display: 'flex',
        flexDirection: 'column',
        alignItems: 'center',
        backgroundColor: 'white',
        padding: theme.spacing(3),
        borderRadius: '8px',
        boxShadow: '0 3px 5px 2px rgba(58, 58, 58, .3)',
    },
    form: {
        width: '100%',
        marginTop: theme.spacing(3),
    },
    submit: {
        margin: theme.spacing(3, 0, 2),
        backgroundColor: '#BA0C2F',
        '&:hover': {
            backgroundColor: '#8A0025',
        },
    },
}));

function App() {
    const classes = useStyles();

    // ... [rest of your state and functions here]

    return (
        <Container component="main" maxWidth="sm">
            <CssBaseline />
            <div className={classes.root}>
                <AppBar position="static" className={classes.appBar}>
                    <Toolbar>
                        <Typography variant="h6" className={classes.logo}>
                            JLL Logo Here
                        </Typography>
                        <Typography variant="h6">
                            Data Doppelg√§nger
                        </Typography>
                    </Toolbar>
                </AppBar>
            </div>
            <div className={classes.paper}>
                {/* ... [rest of your content here] */}
            </div>
        </Container>
    );
};

export default App;
